localStorage.setItem('imgCenter', 'data:image/png;base64,');
localStorage.setItem('imgBackground', 'data:image/png;base64,')

function reducirOpacidad(base64Image, opacidad = 0.2) {
    return new Promise((resolve) => {
      const img = new Image();
      img.src = base64Image;
      img.onload = () => {
        const canvas = document.createElement("canvas");
        canvas.width = img.width;
        canvas.height = img.height;
        const ctx = canvas.getContext("2d");
  
        ctx.globalAlpha = opacidad; // Aplica opacidad
        ctx.drawImage(img, 0, 0);
  
        const imagenOpaca = canvas.toDataURL("image/png");
        resolve(imagenOpaca);
      };
    });
  }  

// Generar y descargar el PDF
function generarCE(datos) {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  // Formatear fecha
  const fechaObj = new Date(datos.fecha + "T00:00:00");
  const fechaFormateada = fechaObj.toLocaleDateString('es-ES', { day: 'numeric', month: 'long', year: 'numeric' });
  
  // Definir imagen
  const imgCenter = localStorage.getItem('imgCenter');
  const imagenOriginal = localStorage.getItem('imgBackground');

  reducirOpacidad(imagenOriginal, 0.2).then(imagenOpaca => {
      doc.addImage(imagenOpaca, 'PNG', 15, 50, 180, 200);
  
      // Inicio del contenido
      doc.addImage(imgCenter, 'PNG', 15, 4, 180, 25);
      
      doc.setFontSize(18);
      doc.setTextColor(0);
      doc.setLineHeightFactor(1.5);
      doc.setFont('times', 'bold');
      doc.text('CONSTANCIA DE ESTUDIOS', 105, 50, { align: 'center' });
      doc.setLineWidth(0.5);
      doc.setDrawColor(0);
      doc.line(150, 51, 60, 51);
      
      doc.setFontSize(12);
      doc.setFont('times', 'normal');
      doc.text('El Director de la Institución Educativa Integrada N.º 32004 "San Pedro", del distrito, provincia y región de Huánuco, que al final suscribe.', 25, 65, { maxWidth: 160 });
     
      doc.setFontSize(14);
      doc.setFont('times', 'bold');
      doc.text('HACE CONSTAR QUE:', 25, 85, { align: 'left' });
      
      doc.setFontSize(12);
      doc.setFont('times', 'normal');
      doc.text(`Que el/la estudiante ${datos.name}, se encuentra estudiando en la Institución Educativa N.º 32004 "San Pedro", cursando el ${datos.grado} grado, sección ${datos.seccion}, del nivel ${datos.nivel} – Cód. Modular ${datos.codm}. Sus datos se encuentran correctamente registrados en el sistema SIAGIE.`, 25, 95, { maxWidth: 160 });
      
      doc.text('Se expide la presente constancia a solicitud de la parte interesada, para los fines que estime convenientes.', 25, 128, { maxWidth: 160 });
      
      doc.setFont('times', 'bold');
      doc.text(`Huánuco, ${fechaFormateada}`, 180, 143, { align: 'right' });
      
      doc.setFont('times', 'normal');
      doc.text('Atentamente,', 105, 153, { align: 'center' });

      doc.setLineWidth(0.5);
      doc.setDrawColor(0);
      doc.setFont('times', 'bold');
      doc.line(65, 200, 145, 200);
      doc.text(`PROF. ${datos.director.toUpperCase()}`, 105, 205, { align: 'center' });
      
      doc.setFontSize(10);
      doc.setFont('times', 'normal');
      doc.text('DIRECTOR', 105, 210, { align: 'center' });

      // Guardar el PDF
      doc.save(`Constancia de Estudios - ${datos.dni}.pdf`);
  });
}